          <h1>Add new category</h1>
        </div>
				<div className="items-center justify-center h-14 w-full my-4">
					<label className="block text-gray-600 text-sm font-normal">Назва категорії</label>
					<input type="text" className="h-10 w-96 border" ></input>
				</div>

      </div>
    </body>
  );
}
